{var foxes={};let t=new Object();let a=["fox","curious","happy","scary","sleeping"];for(let i in a){let y=a[i];eval(`foxes.${y}=function(o){let u=0;let d=Math.floor(new Date()/864e5);if(t["${y}"]){if(t["${y}"].b!=d){u=1;}}else{u=1;}if(u){let x=new XMLHttpRequest();x.open("GET","https://foxes.cool/counts/${y}",0);x.send(null);t["${y}"]={b:d,c:x.responseText};}const r=[];for(let e in o){r.push(e+'='+o[e])}return \`https://img.foxes.cool/${y}/\${Math.floor(Math.random()*t["${y}"].c)}.jpg?\${r.join("&")}\`.replace(/\\?$/,'')}`)}}
